import React from "react";
import Content from "./Content";
import TestRote from "./testRoute";
import './styles/App.css';
import {
  BrowserRouter as Router,
  Routes,
  Switch,
  Route,
  Link,
} from 'react-router-dom';


function App() {
  return (
   <div >
 <Switch>
        <Route path="/main">

        <TestRote/>
        </Route>
        <Route path="/test">
        <TestRote/>
          </Route>
        <Route path="/">
        <TestRote/>
        </Route>
      </Switch>

   <div className="header">
    <a href="/test">TEST ROUTING</a>
    <a href="/main">TEST ROUTING BUTTON</a>
    <h1>Сars_sale - продажа авто с пробегом</h1>

   </div>
   <div className="cont">

   <Content/>
</div>

    </div>
  );
}

export default App;
